import React, { useState } from 'react';
import { auth, firestore } from '../firebase/firebase';
import { useNavigate } from 'react-router-dom'; 
import '../style.css';

const CompleteProfile = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    currentWeight: '',
    goalWeight: '',
    gender: '',
    birthday: '',
    height: '',
    activityLevel: '',
    dietPreferences: '',
    foodAllergies: '',
    goalIntakes: '',
  });
  const [error, setError] = useState(null);
  const navigate = useNavigate(); 

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!formData.firstName) {
      setError('Please fill in first name field.');
      return;
    }

    try {
      const { user } = await auth.createUserWithEmailAndPassword(formData.email, formData.password);
      await firestore.collection('users').doc(user.uid).set({
        firstName: formData.firstName,
        lastName: formData.lastName,
        currentWeight: formData.currentWeight,
        goalWeight: formData.goalWeight,
        gender: formData.gender,
        birthday: formData.birthday,
        height: formData.height,
        activityLevel: formData.activityLevel,
        dietPreferences: formData.dietPreferences,
        foodAllergies: formData.foodAllergies,
        goalIntakes: formData.goalIntakes,
      });
      console.log('User account created');
      navigate('/home'); //sends user to home page
    } catch (error) {
      console.error('Error creating account:', error.message);
      setError(error.message);
    }
  };

  return (
    <div className="loginContainer">
      <div className="imageContainer">
        <img src="https://domf5oio6qrcr.cloudfront.net/medialibrary/11499/3b360279-8b43-40f3-9b11-604749128187.jpg" alt="Login Image" />
      </div>
      <div className="loginBox">
      <div className="logoContainer">
        <img src={require('../logo.png')} alt="Logo" />
      </div>
        <h2 style={{ color: '#557126' }}>Log Into SmartSlice</h2>
        {error && <p>{error}</p>}
        <form onSubmit={handleSubmit}>
          {/* Add input fields for each piece of information */}
          <input type="text" name="firstName" value={formData.firstName} onChange={handleChange} placeholder="First Name" required />
          <input type="text" name="lastName" value={formData.lastName} onChange={handleChange} placeholder="Last Name" />
          <input type="text" name="currentWeight" value={formData.currentWeight} onChange={handleChange} placeholder="Current Weight" />
          <input type="text" name="goalWeight" value={formData.goalWeight} onChange={handleChange} placeholder="Goal Weight" />
          <input type="text" name="gender" value={formData.gender} onChange={handleChange} placeholder="Gender" />
          <input type="text" name="birthday" value={formData.birthday} onChange={handleChange} placeholder="Birthday" />
          <input type="text" name="height" value={formData.height} onChange={handleChange} placeholder="Height" />
          <input type="text" name="activityLevel" value={formData.activityLevel} onChange={handleChange} placeholder="Activity Level" />
          <input type="text" name="dietPreferences" value={formData.dietPreferences} onChange={handleChange} placeholder="Diet Preferences" />
          <input type="text" name="foodAllergies" value={formData.foodAllergies} onChange={handleChange} placeholder="Food Allergies" />
          <input type="text" name="goalIntakes" value={formData.goalIntakes} onChange={handleChange} placeholder="Goal Intakes" />
          {/* Add other input fields similarly */}
          <button type="submit">Sign Up</button>
        </form>
      </div>
    </div>
  );
};

export default CompleteProfile;
